import './App.css';
import Header from './Header';
import Post from './Post';
import {Route, Routes} from "react-router-dom";
import Layout from './LAYOUT.JS';

function App() {
  return (
    <Routes>
      <Route path="/" element ={<Layout/> }/> 
      <Route index element ={
        <Post/>
      }/>
  <Route path={'/login'} element={
    <div>login Page</div>
  } />
    </Routes>
  );
}

export default App;
